export const FreeLessons = () => {
  const videoLessonArray = [
    "https://www.youtube.com/embed/VzIkoH5VXrs?si=VMCkt2Jj2jseN3vi",
    "https://www.youtube.com/embed/DxSTN3kHTDM?si=RMMyScZf-dWHZ_1i",
    "https://www.youtube.com/embed/Qykqk5z1xYE?si=IQwgkNN_AzlCc1mr",
    "https://www.youtube.com/embed/foBZan2J420?si=7tsdBt9AEzJzwq_R",
    "https://www.youtube.com/embed/XbSq44EW5c8?si=tfxbK_4RFDGg3yr8",
    "https://www.youtube.com/embed/83Ml9I9u4Y0?si=KBTpzrZwQ37Q6gHA",
    "https://www.youtube.com/embed/rug3aMFB0jg?si=_KOFCaMgvEmcc3yD",
    "https://www.youtube.com/embed/FnrbM9TqPwc?si=Hh0gvaG9DMeIUEaY",
    "https://www.youtube.com/embed/7RJY0IXXOHY?si=8pESC-ZIaesj6GJP",
    "https://www.youtube.com/embed/TB9mdbB4PDY?si=3LBBeREX-N3NZ3Zi",
    "https://www.youtube.com/embed/qccn2Ihbnac?si=1gXnWP62ROgZqCnJ",
    "https://www.youtube.com/embed/TsPkSfUdQgs?si=_J39iqCxP4AlEKRl",
  ];

  const mapIframes = videoLessonArray.map((video) => {
    return (
      <iframe
        width={"560"}
        height={"315"}
        src={video}
        title="YouTube Video Player"
        frameborder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
        referrerpolicy="strict-origin-when-cross-origin"
        allowfullscreen
      ></iframe>
    );
  });

  return (
    <div>
      <h1>Free Lessons</h1>
      <div id="mapped-video-array">{mapIframes}</div>
    </div>
  );
};
